import React from "react";
import ReactDOM from "react-dom/client";
import "./style.css";
const root=ReactDOM.createRoot(document.getElementById("root"));
function Navbar() {
return(
  <nav>
    <h1>Perfumy</h1>
   <ul>
    <li>home |</li>
    <li>product |</li>
    <li>about |</li>
    <li>contact |</li>
   </ul>
  </nav>
);
}
function Search() {
  return(
    <div className="searchbar">
    <input type="text" placeholder="Search"/>
    </div>
  );
}

function Product() {
  return(
    <div class="product">
        <div class="box">
                <img src="./images/one.jpg"/>
                <p>Fogg Wood Extreme, Eau De Parfum, Long-lasting Perfume, 100ml</p>    
            </div>
            <div class="box">
                <img src="./images/three.jpg" alt="villain"/>
                <p>Fogg Wood Extreme, Eau De Parfum, Long-lasting Perfume, 100ml</p> 
            </div>
            <div class="box">
                <img src="./images/two.jpg" alt="Designs Club"/>
                <p>Designer Club-Be Spoke by Perfume Lounge Men's Perfume | Premium Long Lasting Perfume</p>
            </div>

    </div>
  );
}



root.render(
<div>
<Navbar></Navbar>
<Search></Search>
<Product></Product>
</div>
);
